<!doctype html>
<html lang="hu">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Töri gyakorló by BinderM</title>
  <style>
    :root{
      --bg:#b6e6b1; /* világoszöld háttér */
      --btn:#0b3a66; /* sötétkék gomb */
      --btn-hover:#092d52;
      --white:#ffffff;
      --pink:#ff5fa2; /* rózsaszín gomb */
    }
    html,body{height:100%;margin:0;font-family:Inter, system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", Arial;}
    body{
      background:var(--bg);
      display:flex;
      align-items:center;
      justify-content:center;
      color:var(--white);
      padding:24px;
      box-sizing:border-box;
    }
    .container{
      width:100%;max-width:1000px;display:flex;gap:20px;align-items:center;
      background:rgba(255,255,255,0.08);
      border-radius:16px;padding:20px;box-shadow:0 8px 24px rgba(0,0,0,0.18);
    }
    .left img{
      max-width:240px;border-radius:12px;display:block;
    }
    .right{flex:1;text-align:center;color:#000}
    h1{
      margin:0 0 20px 0;font-size:20px;font-weight:600;letter-spacing:0.4px;color:#000;
    }
    .buttons{display:flex;gap:14px;justify-content:center;margin-bottom:22px;flex-wrap:wrap}
    button.action{
      background:var(--btn);color:var(--white);border:0;padding:14px 22px;border-radius:10px;font-size:16px;cursor:pointer;min-width:120px;
      box-shadow:0 6px 14px rgba(0,0,0,0.25);transition:transform .12s ease, background .12s ease;
    }
    button.action:active{transform:translateY(2px) scale(.995)}
    button.action:hover{background:var(--btn-hover)}
    button.jutalom{
      background:var(--pink);
      color:#fff;
    }
    .result{
      margin-top:8px;padding:22px;background:rgba(255,255,255,0.3);border-radius:12px;min-height:72px;display:flex;align-items:center;justify-content:center;font-size:20px;font-weight:600;color:#000;
    }
    .small{font-size:13px;opacity:0.9;margin-top:10px;color:#000}
    .credit{margin-top:12px;font-size:12px;opacity:0.9;color:#000}
    @media (max-width:700px){
      .container{flex-direction:column}
    }
  </style>
</head>

    <div class="right">
      <h1>töri gyakorló by BinderM</h1>

      <div class="buttons" role="group" aria-label="Válassz kategóriát">
        <button class="action" id="evszamBtn">évszám</button>
        <button class="action" id="szemelyBtn">személy</button>
        <button class="action" id="fogalomBtn">fogalom</button>
        <button class="action jutalom" id="jutalomBtn">jutalom</button>
      </div>

      <div class="result" id="result" aria-live="polite">Kattints egy gombra a véletlenszerű tételhez</div>
      <div class="small">A gombokra kattintva véletlenszerű tétel jelenik meg az adott kategóriából.</div>
      <div class="credit">&copy; BinderM — töri gyakorló</div>
    </div>
  </div>

  <script>
    // Adatlisták
    const evszamok = [1914,1917,1918,1929,1933,1939];
    const szemelyek = ["Hitler","Sztálin","Roosevelt","Lenin","Mussolini"];
    const fogalmak = [
      "liberalizmus","nacionalizmus","parlament","bíróságok","kormány","cenzúra",
      "sztrájk","szakszervezet","gyár","polgárháború","propaganda","gyarmat",
      "monopólium","antiszemitizmus","fasizmus","személyi kultusz","koncepciós per",
      "tervgazdálkodás","kulák","hitel","tőkés","tőzsde","részvény","New Deal","Gestapo","SS"
    ];
    const jutalmak = [
      "1 rablókártya",
      "1 lustaságkártya",
      "sajnálom nem nyert",
      "1 pacsi",
      "tapsvihar",
      "most semmi :-(",
      "Ügyes voltál!",
      "1 pont",
      "2 pont"
    ];

    function veletlenElem(arr){
      return arr[Math.floor(Math.random()*arr.length)];
    }

    const resultEl = document.getElementById('result');
    function show(text){
      resultEl.style.opacity = 0;
      setTimeout(()=>{
        resultEl.textContent = text;
        resultEl.style.opacity = 1;
      },120);
    }

    document.getElementById('evszamBtn').addEventListener('click', ()=>{
      show(veletlenElem(evszamok));
    });
    document.getElementById('szemelyBtn').addEventListener('click', ()=>{
      show(veletlenElem(szemelyek));
    });
    document.getElementById('fogalomBtn').addEventListener('click', ()=>{
      show(veletlenElem(fogalmak));
    });
    document.getElementById('jutalomBtn').addEventListener('click', ()=>{
      show(veletlenElem(jutalmak));
    });

    window.addEventListener('keydown', (e)=>{
      if(e.key === '1') document.getElementById('evszamBtn').click();
      if(e.key === '2') document.getElementById('szemelyBtn').click();
      if(e.key === '3') document.getElementById('fogalomBtn').click();
      if(e.key === '4') document.getElementById('jutalomBtn').click();
    });
  </script>
